  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Aleutian Islands
  and Izembek NWRs outlines Refuge accomplishments from May through August of 1961.
  The report begins by summarizing the weather conditions, habitat conditions, and
  food and cover during this period. Wildlife- including migratory birds, upland game
  birds, big game animals, predators, rodents, mammals, and raptors- is also covered.
  Resource management is outlined; topics include grazing and fur harvesting. A progress
  report on field investigations and applied research is also provided. The public
  relations section of the report describes recreational uses, Refuge visitors, hunting,
  violations, and safety. Items of interest, N-R forms, and photographs are attached.\",\n\t\"license_title\":
